INSERT INTO `js_sys_config` VALUES ('1219571614869598208', '用户管理-密码修改多少次内不允许重复', 'sys.user.passwordModifyNotRepeatNum', '1', '0', 'system', '2020-1-21 18:45:06', 'system', '2020-1-21 18:45:06', '默认1次，表示不能与上次密码重复；若设置为3，表示并与前3次密码重复');
